server.post('/auth', (req, res) => {
	var item;
	const ip = (req.ip || req.headers['x-forwarded-for'] || req.connection.remoteAddress);
	const token = (req.body['token'] || '').replace(/\s/g, '');
	
	if(item = tokens.find(item => item.token == token))
		db.whitelist.push({
			ip, token, id: item.id, username: req.body['username'],
		}),
		res.cookie('token', token, {
			maxAge: 365 * 24 * 60 * 60 * 1000, 
			httpOnly: true,
		}),
		res.send(render('사용자 인증', '<p>사용자 인증에 성공했습니다</p><a href=/ >[홈으로]</a>'));
	else
		res.send(render('사용자 인증', '<p>사용자 인증에 실패했습니다</p><a href=/ >[다시 시도]</a>'));
});

