server.post('/posts/new', (req, res) => {
	if((req.body['title'] || '').startsWith('￡')) return res.send(render('글쓰기', '<p>제목은 ￡로 시작할 수 없습니다</p><a href=# onclick="history.back();">[돌아가기]</a>'));
	const ip = (req.ip || req.headers['x-forwarded-for'] || req.connection.remoteAddress);
	const a = db.whitelist.find(item => item.ip == ip && item.token == req.cookies['token']);
	
	var id = db.posts.length;
	
	db.posts[id] = ({
		id,
		title: req.body['title'],
		content: req.body['content'],
		private: req.body['private'] ? true : false,
		author: a.id,
		comments: [],
		timestamp: new Date().getTime(),
		date: new Date().getTime(),
		public: req.body['public'] ? true : false,
		allowComments: req.body['allowcomments'] ? true : false,
		publicComments: req.body['publiccomments'] ? true : false,
	});
	
	res.redirect('/posts/' + id);
});

server.get('/posts/:id', (req, res) => {
	const id = req.params['id'];
	const post = db.posts[id];
	if(!post || (post && post.title.startsWith('￡'))) return res.send(render('게시판', '<p>삭제되었거나 없는 글입니다</p><a href=/posts>[목록]</a>'));
	const ip = (req.ip || req.headers['x-forwarded-for'] || req.connection.remoteAddress);
	
	var comments = `
		<div id=res-container>
	`;
	
	for(var item of post.comments) {
		comments += `
			<div class=res-wrapper>
				<div class="res res-type-normal">
					<div class=r-head>
						#${item.id} ${db.whitelist.find(itm => itm.id == item.author).username} (${item.author})
					</div>
					
					<div class=r-body>
						<p>${item.content}</p>
					</div>
				</div>
			</div>
		`;
	}
	
	comments += `
		</div>
		
		<form method=post action="/posts/${id}/comment">
			<textarea name=text rows=3 class=form-control></textarea>
		</form>
	`;
	
	res.send(render(post.title, `
		<h4>${post.title}</h4>
		<p>${db.whitelist.find(item => item.id == post.author).username} (${post.author})</p>
		
		<div>
			${post.content}
		</div>
		
		${comments}
		
		<br />
		
		<a href=/posts>[목록]</a>
	`));
});

