const ftpsrv = require('ftp-srv');

const ftp = new ftpsrv({
    url: 'ftp://192.168.0.10:21',
    file_format: 'ls',
    anonymous: false,
    greeting: ['비밀의 겨울눈밭'],
});


ftp.on('login', (data, resolve, reject) => {
	return reject({});
	
    if(data.username === '' && data.password === '') {
        return resolve({
			root: './downloadable/',
			blacklist: ['ALLO', 'APPE', 'DELE', 'MKD', 'RMD', 'RNRF', 'RNTO', 'STOR', 'STRU'],
		});
    } else {
        return reject({});
    }
});

ftp.listen();

